function App() {
    return (
        <Navbar>
        </Navbar>
    );
}

function Navbar(props) {
    return (
        <nav className={styles.navbar}>
            <ul className={styles.navbar_nav}> {props.children} </ul>
        </nav>
    );
}

function NavItem(props) {
    return (
        <nav className={styles.nav_item}>
            <a href="#" className={styles.icon_button}> 
                {props.icon} 
            </a>
        </nav>
    );
}

export default App;
